        <Link style={styles.link} to="/">Home</Link>
         <Link style={style.link} to="/Workers">Services</Link>
        <Link style={style.link} to="/signup">Signup</Link>
       
        <Link style={styles.link} to="/login">Login</Link>
        
      </div>
    </nav>
  );
};

const styles = {
  navbar: {
    display: 'flex',
    justifyContent: 'space-between',
    padding: '1rem 2rem',
