    color: 'white',
    alignItems: 'center'
  },
  logo: {
    fontWeight: 'bold',
    fontSize: '1.5rem'
  },
  link: {
    margin: '0 1rem',
    color: 'white',
    textDecoration: 'none',
    fontWeight: '500'
  }
};

export default Navbar;
